	}

	render(){
		var receta = {
			nombre: 'Pizza',
			Ingredientes:[
				{
					nombre: 'tomate',
					cantidad: 5
				},
				{
					nombre: 'queso',
					cantidad: 8
				},
				{
					nombre: 'masa',
					cantidad: 2
				}
			],
			calorias: 300
		};

		return(
			<section>
				<h1>Receta de : {receta.nombre}</h1>
				<h3>Calorias: {receta.calorias}</h3>

			</section>
		);
	}
}

export default MyComponent;
